import React, { useEffect, useState } from "react";
import Header from "../common/Header";
import UploadButton from "../common/UploadButton";
import SideNav from "../common/SideNav";
import Content from "../main/Content";
import Sort from "../main/Sort";
import MainWrapper from "../styled/commonStyled/MainWrapper";
import ContentWrapper from "../styled/mainStyled/ContentWrapper";
import HomeWrapper from "../styled/mainStyled/HomeWrapper";
import Upload from "../upload/Upload";
import { Route, Routes, Link } from "react-router-dom";
import Post from "./Post";
import axios from "axios";
const Main = () => {
  const [lastPostId, setLastPostId] = useState("");

  const options = {
    root: null,
    rootMargin: "20px",
    threshold: 1.0,
  };

  useEffect(async () => {
    await axios.get("api/v1/posts/recent").then((res) => {
      let lastId = res.data[res.data.length - 1].postsId;
      setLastPostId(lastId);
    });
  }, []);
  const handleClick = () => {
    axios.get(`api/v1/posts/${lastPostId}/recent`).then((res) => {
      console.log(res);
    });
  };

  return (
    <HomeWrapper>
      <SideNav />
      <MainWrapper>
        <ContentWrapper>
          <Sort />

          <Content />
          <button onClick={handleClick}>click</button>
        </ContentWrapper>
        <UploadButton />
      </MainWrapper>
    </HomeWrapper>
  );
};

export default Main;
